@Injectable({
  providedIn: 'root'
})
export class UtilsService {

  constructor(
    public snackBar: MatSnackBar,
    public dialog: MatDialog,
    public actionDialog: MatDialog,
    private deviceService: DeviceDetectorService
  ) { }

  // used to match password
  public matchOtherValidator(otherControlName: string) {

    let thisControl: FormControl;
    let otherControl: FormControl;

    return function matchOtherValidate(control: FormControl) {
      if (!control.parent) {
        return null;
      }
      // Initializing the validator.
      if (!thisControl) {
        thisControl = control;
        otherControl = control.parent.get(otherControlName) as FormControl;
        if (!otherControl) {
          throw new Error('matchOtherValidator(): other control is not found in parent group');
        }
        otherControl.valueChanges.subscribe(() => {
          thisControl.updateValueAndValidity();
        });
      }
      if (!otherControl) {
        return null;
      }
      if (otherControl.value !== thisControl.value) {
        return {
          matchOther: true
        };
      }
      return null;
    }
  }

  // used to match password
  public nonequalPasswordValidator(otherControlName: string) {

    let thisControl: FormControl;
    let otherControl: FormControl;

    return function nonequalPasswordValidator(control: FormControl) {
      if (!control.parent) {
        return null;
      }
      // Initializing the validator.
      if (!thisControl) {
        thisControl = control;
        otherControl = control.parent.get(otherControlName) as FormControl;
        if (!otherControl) {
          throw new Error('nonequalPasswordValidator(): other control is not found in parent group');
        }
        otherControl.valueChanges.subscribe(() => {
          thisControl.updateValueAndValidity();
        });
      }
      if (!otherControl) {
        return null;
      }
      if (otherControl.value == thisControl.value) {
        return {
          matchOther: true
        };
      }
      return null;
    }
  }

  public showSnackBar(message) {
    this.snackBar.open(message, null, {
      duration: 5000
    })
  }

  public showDialog(title, message) {
    const dialogRef = this.dialog.open(AlertDialogComponent, {
      // width: '400px',
      data: {
        title: title,
        message: message
      }
    })
    return dialogRef;
  }

  public showActionDialog(title, message) {
    const actionDialogRef = this.actionDialog.open(ActionDialogComponent, {
      width: '400px',
      data: {
        title: title,
        message: message,
        // actionChoosen: Boolean
      }
    })
    return actionDialogRef;
  }


   /**
   * showFileInNewTab
   * @param data 
   * @param name 
   * 
   * This function creates blob from the base64 data url
   * used for downloading files uploaded in pos
   */
  async showFileInNewTabFromB64(data, name) {
    const response = await fetch(data);
    const blob = await response.blob();
    const file = new File([blob], name) // file will not work in chrome
    const url = window.URL.createObjectURL(blob);


    // console.log(window.navigator.userAgent)
    // console.log(this.deviceService.getDeviceInfo())

    var browser = this.deviceService.getDeviceInfo().browser
    if (browser == "MS-Edge" || browser == "MSIE") {
      window.navigator.msSaveOrOpenBlob(file, name);
    } else {
      window.open(url);
    }

  }



  public formatBytes(bytes, decimals?) {
    if (bytes === 0) { return '0 Bytes'; }
    const k = 1024,
      dm = decimals || 2,
      sizes = ['Bytes', 'KB', 'MB', 'GB', 'TB', 'PB', 'EB', 'ZB', 'YB'],
      i = Math.floor(Math.log(bytes) / Math.log(k));
    return parseFloat((bytes / Math.pow(k, i)).toFixed(dm)) + ' ' + sizes[i];
  }

  public generatePDF(title, subtitle, qrcodeData, fileName, pdfContentColumnArray, pdfContentRowArray) {

    const qrCodeData = this.getQRCodeData(qrcodeData);
    const pdf = new jspdf('l', 'mm', 'a4');
    var pageWidth = pdf.internal.pageSize.width || pdf.internal.pageSize.getWidth();
    var pageHeight = pdf.internal.pageSize.height || pdf.internal.pageSize.getHeight();

    // logos
    pdf.addImage(this.logos.poeLogo, 'png', 15, 10, 26, 26)
    pdf.addImage(this.logos.cdacLogo, 'JPG', pageWidth - 44, 13, 27, 20)

    // header
    // pdf.setFont("times");
    pdf.setFontSize(20);
    pdf.text(pageWidth - (pageWidth / 2), 21, title, 'center');
    pdf.setFontSize(14);
    pdf.setTextColor('#2E8B57');
    pdf.text(pageWidth - (pageWidth / 2), 28, subtitle, 'center');
    pdf.line(14, 42, pageWidth - 14, 42);

    //table data -----------------------------
    pdf.autoTable({
      head: pdfContentColumnArray,
      body: pdfContentRowArray,
      margin: { top: 52 } 
    });

    // qrcode
    pdf.addImage(qrCodeData, 'JPG', pageWidth - 44, pageHeight - 64, 32, 32)

    // qrdata url
    pdf.setFontSize(11);
    pdf.setTextColor('#FF00CC');
    var splitTitle = pdf.splitTextToSize(qrcodeData);
    pdf.text(16, pageHeight - 35, splitTitle, 'left');
    pdf.setFontStyle('italic')

    // instruction
    pdf.setFontSize(10);
    pdf.setTextColor('#2E8B57');
    pdf.text(16, pageHeight - 46, "Scan QR-Code or visit following url to verify authenticity of document.", 'left');
    // pdf.text(16, pageHeight - 46, "This document is computer generated and hence does not require signature.", 'left');

    // footer
    pdf.line(14, pageHeight - 20, pageWidth - 14, pageHeight - 20);
    pdf.setFontStyle('normal')
    pdf.text(pageWidth - (pageWidth / 2), pageHeight - 8, 'Â© Centre for Development of Advanced Computing (C-DAC), Hyderabad', 'center');
    pdf.save(fileName + '.pdf');
  }

  public getQRCodeData(text: string) {
    return kuja({
      render: "canvas",
      crisp: true,
      minVersion: 1,
      ecLevel: "Q",
      size: 1200,
      ratio: undefined,
      fill: "#333",
      back: "#fff",
      text,
      rounded: 10,
      quiet: 6,
      mode: "label",
      mSize: 12,
      mPosX: 50,
      mPosY: 103,
      label: "C-DAC's PoE",
      fontname: "Ubuntu",
      fontcolor: "#3F51B5",
      image: ''
    });
  }

  logos = {

    cdacLogo: 'data:image/png;base64,',

    poeLogo : ''
  }
}
